import React, { useState } from "react";
import { Link } from "react-router-dom";
import service from "./service";
import "./register.css"; // üëà ◊ó◊©◊ï◊ë

export default function Register() {
  const [form, setForm] = useState({ userName: "", password: "" });
  const [showPass, setShowPass] = useState(false);
  const [loading, setLoading] = useState(false);
  const [err, setErr] = useState("");

  const passStrength = (() => {
    const p = form.password;
    let s = 0;
    if (p.length >= 8) s++;
    if (/[A-Z◊ê-◊™]/.test(p)) s++;
    if (/[0-9]/.test(p)) s++;
    if (/[^A-Za-z0-9]/.test(p)) s++;
    return s; // 0..4
  })();

  async function handleSubmit(e) {
    e.preventDefault();
    setErr("");
    if (!form.userName.trim()) return setErr("◊†◊ê ◊ú◊î◊ß◊ú◊ô◊ì ◊©◊ù ◊û◊©◊™◊û◊©");
    if (form.password.length < 6) return setErr("◊°◊ô◊°◊û◊î ◊ó◊ô◊ô◊ë◊™ ◊ú◊î◊ô◊ï◊™ ◊ë◊ê◊ï◊®◊ö 6 ◊™◊ï◊ï◊ô◊ù ◊ú◊§◊ó◊ï◊™");

    try {
      setLoading(true);
      await service.register(form.userName.trim(), form.password);
      window.alert("◊†◊®◊©◊û◊™ ◊ë◊î◊¶◊ú◊ó◊î!");
      window.location.href = "/login";
    } catch {
      setErr("◊©◊ù ◊û◊©◊™◊û◊© ◊õ◊ë◊® ◊ß◊ô◊ô◊ù");
    } finally {
      setLoading(false);
    }
  }

  return (
    <div className="auth-page" dir="rtl">
      <nav className="auth-nav">
        <Link to="/" className="nav-link">Todos</Link>
        <span className="sep">‚Ä¢</span>
        <Link to="/login" className="nav-link">◊î◊™◊ó◊ë◊®◊ï◊™</Link>
        <span className="sep">‚Ä¢</span>
        <span className="nav-link current">◊î◊®◊©◊û◊î</span>
      </nav>

      <div className="card">
        <h2 className="title">◊î◊®◊©◊û◊î</h2>

        {err && <div className="alert">{err}</div>}

        <form onSubmit={handleSubmit} className="form">
          <label className="label">◊©◊ù ◊û◊©◊™◊û◊©</label>
          <input
            className="input"
            placeholder="◊ú◊ì◊ï◊í◊û◊î: michal_b"
            value={form.userName}
            onChange={(e) => setForm({ ...form, userName: e.target.value })}
            autoComplete="username"
          />

          <label className="label row-between">
            <span>◊°◊ô◊°◊û◊î</span>
            <button
              type="button"
              className="link-ghost"
              onClick={() => setShowPass((v) => !v)}
              aria-label={showPass ? "◊î◊°◊™◊® ◊°◊ô◊°◊û◊î" : "◊î◊¶◊í ◊°◊ô◊°◊û◊î"}
            >
              {showPass ? "◊î◊°◊™◊®" : "◊î◊¶◊í"}
            </button>
          </label>
          <input
            className="input"
            type={showPass ? "text" : "password"}
            placeholder="◊û◊ô◊†◊ô◊û◊ï◊ù 6 ◊™◊ï◊ï◊ô◊ù"
            value={form.password}
            onChange={(e) => setForm({ ...form, password: e.target.value })}
            autoComplete="new-password"
          />

          {/* ◊§◊° ◊ó◊ï◊ñ◊ß ◊°◊ô◊°◊û◊î */}
          <div className="strength">
            <div className={`bar ${passStrength >= 1 ? "on" : ""}`} />
            <div className={`bar ${passStrength >= 2 ? "on" : ""}`} />
            <div className={`bar ${passStrength >= 3 ? "on" : ""}`} />
            <div className={`bar ${passStrength >= 4 ? "on" : ""}`} />
          </div>

          <button className="btn" type="submit" disabled={loading}>
            {loading ? "◊†◊®◊©◊ù..." : "◊î◊®◊©◊ù"}
          </button>
        </form>

        <p className="foot">
          ◊õ◊ë◊® ◊ô◊© ◊ú◊ö ◊û◊©◊™◊û◊©? <Link to="/login" className="link-inline">◊ú◊û◊°◊ö ◊î◊î◊™◊ó◊ë◊®◊ï◊™</Link>
        </p>
      </div>
    </div>
  );
}
